    "2013-06-12T18:00:53.634007",nt"name": "lidar-elevation-blue-earth-county-minnesota-2005",nt"isopen":
    false,nt"url": null,nt"notes": "The original data was classified bare-earth
    LiDAR DEM and photogrammetrically derived breaklines generated from LiDAR Intensity
    stereo-pairs in ESRI ASCII 3D Generate format and Microstation SE .dgn format for
    Blue Earth County, Minnesota. The data was further processed by the Minnesota Department
    of Natural Resources to create and distribute feature classes in this geodatabase
    version. The LiDAR data for Blue Earth County was collected under contract by the
    county. Thus, the data format is not entirely consistent with some of the other
    LiDAR data available in Minnesota. Specifically, the Blue Earth county collect only
    required classification of Bare Earth in the LiDAR LAS files, so there is no information
    on buildings, vegetation, or model key points. Breaklines captured as part of this
    effort are also a bit different since they are 3D Polyline features rather than
    3D Polygon features. They also include road centerlines, stream courses and other
    features that are not part of the Statewide collect specifications. Note: This metadata
    record was created at the Minnesota Geospatial Information Office using information
    supplied by Optimal Geomatics, Inc., Blue Earth County, and the Minneosta Department
    of Natural Resources.",nt"license_title": null,nt"extras": [{ntt"key":
